	"sapmarco/projectpages/i18n/18n_en_US.properties":'title=projectpages\nappTitle=projectpages\nappDescription=App Description\nsectionSkills=What am I working with?\nroughOverview=- Rough Overview -\nVersionname=Projectname: \nUI5Ver=Version: \nfooterText=I\'m just a little demo project, don\'t hurt me. Kill me. Now.\nthemeToggleTooltip=Toggle Theme\nversionInfoTooltip=Check Version\nUI5VerDlgTitle=Version Information (package.json)\nUI5VerDlgClose=Close\nwiki=Wiki/Blog\nsidebar=Navigation\nsource=View on Github\nsourceTooltip=Wiki\nintroText=Dedicated ABAP developer that also takes great interest in exploring things beyond my known field of work.\nmainText=Hey there! My name is Marco and this is a demo page where I practice a few UI5/Web Development specific things. It has a bit of information about me here and there. To learn more just follow me on one of the social media sites linked above. \\n Any feedback is very much appreciated as I\'m not a \'real\' UI5 developer in my current working position but mostly learn about it in my spare time. There are other topics like CAP (Cloud in general), CDS, OData and so forth that also highly interest me. \\n\\n A Short description of myself would be: \'Jack of all trades - but master of none\'.',
	"sapmarco/projectpages/i18n/i18n.properties":'title=projectpages\nappTitle=projectpages\nappDescription=Project SPA on Github.io\n',
	"sapmarco/projectpages/i18n/i18n_de_DE.properties":'title=projectpages\nappTitle=projectpages\nappDescription=App Description\nsectionSkills=Womit arbeite ich?\nroughOverview=- Grobe \\u00dcbersicht -\nVersionname=Projektname: \nUI5Ver=Version:  \nfooterText=Ich bin nur ein Demo-Projekt.\nthemeToggleTooltip=Switch Theme\nversionInfoTooltip=Version\nUI5VerDlgTitle=Version Information (package.json)\nUI5VerDlgClose=Schliessen\nwiki=Wiki/Blog\nsidebar=Navigation\nsource=Auf Github ansehen\nsourceTooltip=Wiki\nintroText=Engagierter ABAP-Entwickler, der auch gerne mal ueber den SAP-Rand hinausblickt um neues zu lernen und entdecken. \nmainText=Hey! Mein Name ist Marco und dies ist eine Demo-Seite, auf der ich einige UI5/WebDev-spezifische Dinge uebe. Hier und da gibt es ein paar Informationen ueber mich. Um mehr zu erfahren, folge mir einfach auf einen der oben verlinkten Social-Media-Seiten. \\n Jegliche Art von Feedback ist sehr geschaetzt, da ich in meiner derzeitigen Position auf Arbeit nicht wirklich mit UI5 arbeite, lerne ich hauptsaechlich in meiner Freizeit. Darueber hinaus interessieren mich weitere Themen wie: CAP (bzw. alles rund um die Cloud), CDS, OData und so weiter... \\n\\n Muesste ich mich in einem Satz beschreiben waere das wohl: \'Jack of all trades - and master of none\'.',
